import classes from "./MenuDeFilter.module.css";

function MenuDeFilter() {
  return (
      <div className={classes.menu}>
        <a href="#" class="active">
          Home
        </a>
        <a href="#">Link 1</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
        <a href="#">Link 4</a>
      </div>

  );
}

export default MenuDeFilter;
